INSERT INTO `games` (`title`, `description`, `loc`, `playpage`, `id`, `rating`, `pop`) VALUES
('Find Veep', 'Find the veep twins and match them up to win!', 'https://www.veeple.online/games/findveep/', 'findveep.php', 1, '', 0),
('Space Defender', 'Shoot down asteroids and your enemies in this 8 bit style arcade!\r\nUse the arrow keys and space bar or mouse', 'https://www.veeple.online/games/spacedefender/', 'spacedefender.php', 2, '', 0),
('Asteroids', 'Fly through space and blow up the asteroids for points!', 'https://www.veeple.online/games/asteroids/', 'asteroids.php', 3, '', 2),
('Piggy Fly', 'Jump from platform to platform and avoid the falling rocks to get the high score!', 'https://www.veeple.online/games/piggyfly/', 'piggyfly.php', 4, '', 1),
('Disco Dash', 'Dash through the disco and avoid the spikes to make it to the next level', 'https://www.veeple.online/games/discodash/', 'discodash.php', 5, '', 4),
('Invaders', 'Fight off the Invaders before they reach your ship!', 'https://www.veeple.online/games/invaders/', 'invaders.php', 6, '', 2),
('Super Laser Zombie Invasion', 'Zombies? Super Lasers? What more could you ask for?', 'https://www.veeple.online/games/superlaserzombieinvasion/', 'superlaserzombieinvasion.php', 7, 'M', 2),
('Coin Drop', 'Use your Veep Coin to try and score some mega gold!', 'https://www.veeple.online/games/coindrop/', 'coindrop.php', 8, '', 21),
('City Bird', 'Fly through the city and score some mega points!', 'https://www.veeple.online/games/citybird/', 'citybird.php', 9, '', 9),
('Defuse!', 'Click on the buttons to defuse the bomb!', 'https://www.veeple.online/games/defuse/', 'defuse.php', 10, '', 1),
('StackEm', 'Stack the boxes up as high as you can without dropping any and score some mega points and coins!', 'https://www.veeple.online/games/stackem/', 'stackem.php', 11, '', 18);
