INSERT INTO `news` (`id`, `title`, `post`, `time`, `postby`) VALUES
(1, 'Veeple.Online is LIVE!!!', 'Veeple is live and functional! We are taking sign ups and new users. Veep is still under construction so there may be a few bugs here and there as we work through them so please bare with us. Every day we are adding more and more features to users and fun', '2019-07-24 22:35:18', ''),
(2, 'Veeple is on Facebook', 'That\'s right Veep is on facebook and we will be posting news to our Facebook page as well. Make sure you head over to our Facebook page and give it a like!\r\n\r\n<!-- Code for Facebook Plug -->\r\n\r\n</br></br>\r\n<div class=\"fb-like\" data-href=\"https://veeple.online\" data-width=\"\" data-layout=\"button\" data-action=\"like\" data-size=\"large\" data-show-faces=\"true\" data-share=\"true\"></div>', '2019-07-24 23:02:03', 'Kyle'),
(3, 'Power Naps!', 'You can now power nap your veep to bring it to 100% energy! With this new feature it comes at a cost of 50 veep coin. Tokens can be earned daily so they will accumulate over time. Enjoy your nap time!', '2019-07-29 19:46:54', ''),
(4, 'Bugs and fixes', 'Alright so there have been a ton of bugs being worked through recently. Good news is though, the bulk of them have been fixed.\r\n</br></br>\r\nAs we improve and add new features to the site, we expect these sorts of things and work as quickly as we can to get everything back up and running. Thanks for the understanding. In other news we are adding more veep types and they are here and live now! We are working on a adoption center so stay tuned for that as well. Feel free to report any issues you are experiencing</br></br><a href=\"reportissue.php\" target=\"_blank\">Report Issue</a>', '2019-08-01 20:14:44', 'Kyle'),
(5, 'Veeple.Online Games', 'Few of many but it is here! Veeple.Online Games! Play today and win veep coins. Playing a game will also bring your veep to full happiness! \r\n\r\n<!-- Code for games to display -->\r\n\r\n</br></br><a href=\"findveep.php\"><div class=\"allveeps\"><img src=\"/games/findveep/thumb.gif\" alt=\"Find Veep\"></br><b>Find Veep</b><span class=\"tooltiptext\">Match up the veep twins and win veep coins!</span></div></a><a href=\"spacedefender.php\"><div class=\"allveeps\"><img src=\"/games/spacedefender/thumb.gif\" alt=\"Space Defender\"></br><b>Space Defender</b><span class=\"tooltiptext\">Defend space in this 8 bit classic and win veep coins!</span></div></a><div class=\"allveeps\"><img src=\"/games/asteroids/thumb.gif\" alt=\"Asteroids\"></br><b>Asteroids</b><span class=\"tooltiptext\">Blow up Asteroids in this 8 bit classic and win veep coins!</span></div></a>', '2019-08-05 22:51:18', 'Kyle'),
(7, 'Veeple.Online Is Better With Friends!', 'That\'s right! You can now add your friends on Veeple.Online so you can easily take care of each others veep. Head to your besties profile and send them a friend request today!', '2019-08-19 18:21:17', 'Kyle'),
(9, 'Have you noticed?', 'Have you noticed the envelope up in the navigation bar?\r\nVeeple.Online now has inboxes where you can send mail to your friends! You must be friends in order to mail a message to them. Enjoy!', '2019-08-27 23:03:58', 'Kyle'),
(10, 'Release!', 'Its finally time! We are happy to announce that Veeple.Online is now in a released stage!\r\n\r\nSo what does that mean?\r\nIt means that most of the bugs have been worked out and tested. The site load times have been heavily reduced as well. This is a huge step. We are still constantly looking to improve the site and adding new features all the time. If you have not yet jump online and adopt your very first Veep!', '2019-09-04 19:25:08', 'Kyle');
